const Contact = () => {
  return (
    <form action="https://formspree.io/xyynberj" method="POST">
      <label htmlFor="">
        Your email:
        <input type="text" name="_replyto" />
      </label>

      <label htmlFor="">
        Your message:
        <textarea name="message"></textarea>
      </label>

      <button type="submit">Send</button>
    </form>
  );
};

export default Contact;

